<!DOCTYPE html>
<html>
<head>
<style type="text/css">
* {
    -webkit-box-sizing: border-box;
    -moz-box-sizing: border-box;
    box-sizing: border-box;
}

html {
    font-size: 10px;
}

body {
    overflow : hidden;
    font-family: sans-serif;
    font-size: 14px;
    line-height: 1.42857143;
    color: #333;
    background-color: #fff;
    color: #0f3c4b;
    padding: 0;
}

h2 {
    font-size: 30px;
    font-family: inherit;
    font-weight: 500;
    line-height: 1.1;
    color: inherit;
    margin-bottom: 10px;
}

label {
    display: inline-block;
    max-width: 100%;
    margin-bottom: 5px;
    font-weight: 700;
}

.hidden {
    display: none!important;
}

.container {
    width: 100%;
    max-width: 680px;
    text-align: center;
    margin: 0 auto;
}

.form-group {
    margin-bottom: 5px;
}
body {
    margin: 0;
}

#svg {
    position: absolute;
    height: 100vh;
    margin-left: 0;
    width: 100vw;
    padding: 0;
    background: white;
}

#svg.show.duration svg {
    transition-duration: 1s;
}

#frame {
    height: 100%;
    overflow: hidden;
}

#content {
    display: flex;
    flex-direction: column;
    margin: 5px;
    height: calc(100vh - 10px);
}

#content svg {
    height: 100%;
    min-height: calc(75vh - 10px);
    width: calc(100vw - 10px);
}

#fit-page-to-drawing {
    font-size: 5vh;
    margin-left: -7vh;
    margin-top: 0.8vh;
    top: 0;
    bottom: 0;
    position: fixed;
    cursor: pointer;
    width: 5vh;
    height: 6.5vh;
    z-index: 1;
}

#fit-page-to-drawing > div {
    background: white;
    width: 3.8vh;
    height: 3.6vh;
    border: solid .3vh black;
    border-top: solid .6vh black;
}

#real-legend {
     margin-left: 5rem;
     min-height: 9vh;
     max-height: 25vh;
     overflow: auto;
}

#real-legend label {
    vertical-align: top;
    position: relative;
    z-index: 1;
}

#real-legend label span,
#indices article.indice > div {
    width: 4vh;
    height: 4vh;
    font-size: 2vh;
    padding: .1vh;
    color: #fff;
    text-align: center;
    vertical-align: middle;
    background-color: #d9534f;
    border: solid .4vh white;
    border-radius: .5vh;
    display: block;
    cursor: pointer;
}

#real-legend label span {
    display: inline-block;
    border-color: black;
    border-radius: 1.1vh;
}

#real-legend label em {
    padding-right: 1rem;
}

#indices {
    position: absolute;
    width: calc(-10px + 100%);
    height: calc(-10px + 100%);
    z-index: 1000;
}

#indice-editor {
    position: absolute;
    bottom: 5px;
}

#indices article {
    position: absolute;
    margin: -1.75vh -2.25vh;
    top: 50%;
    left: 50%;
}

#indices article .indice {
    width: 4vh;
    height: 4vh;
    font-size: 2vh;
    padding: .1vh;
    color: #fff;
    text-align: center;
    vertical-align: middle;
    background-color: #d9534f;
    border: solid .4vh white;
    border-radius: .5vh;
    display: block;
    cursor: pointer;
}

#svg svg {
    width: 100%;
    height: 100%;
}

#svg .mask {
    cursor: auto;
}

#svg .indice text {
    font-size: 14px;
}

#svg .indice .mask {
     fill: transparent;
    cursor: pointer;
}

.container .save {
    display: inline-block;
}

.description {
    z-index: 1;
    width: 35vw;
    margin: 11vh 2vw;
    display: block;
    position: absolute;
    background: white;
    padding: .5rem;
    border-radius: .5rem;
    border: 1px solid rgba(0,0,0,.15);
    -webkit-box-shadow: 0 1rem 2rem rgba(0,0,0,.6);
    box-shadow: 0 1rem 2rem rgba(0,0,0,.6);
}

.description h2 {
    margin-top: 0;
}

.description .indice {
    position: static;
    display: inline-block;
    font-size: 2rem;
    width: 3.8rem;
    height: 3.8rem;
    color: #fff;
    text-align: center;
    vertical-align: middle;
    background-color: #d9534f;
    border: solid .4vh black;
    border-radius: .5rem;
    margin: .2rem;
    padding: .8rem;
    padding-top: .5rem;
}

</style>
</head>

<script type="text/javascript">
var SVG = {
  x:             0,
  y:             0,
  width:         0,
  height:        0,
  ratio:         0,
  content_ratio: 0,
  indice_left:   0,
  indice_top:    0,
  indice_height: 0,
  indice_width:  0,
  biggest:       0,
  scale:         0,
  init: function() {
    "use strict";
    var svg_box  = $("#svg svg")[0].getBBox();
    this.x       = svg_box.x;
    this.y       = svg_box.y;
    this.width   = svg_box.width;
    this.height  = svg_box.height;
    this.ratio   = this.width / this.height;
    this.biggest = Math.max(this.width, this.height);
    this.scale   = this.biggest / 300;
    this.content_ratio = $("#svg").width() / $("#svg").height();
    if (this.ratio > this.content_ratio) {
      this.indice_left = 0;
      this.indice_top = parseInt(($("#svg").height() - $("#svg").width() / this.ratio) / 2);
      this.indice_height = 5 + parseInt($("#svg").width() / this.ratio);
      this.indice_width = $("#svg").width();
    }
    else {
      this.indice_left = parseInt(($("#svg").width() - $("#svg").height() * this.ratio) / 2);
      this.indice_top = 0;
      this.indice_width = 5 + parseInt($("#svg").height() * this.ratio);
      this.indice_height = $("#svg").height();
    }
  }
};

function translate(trans_x, trans_y) {
  "use strict";
  var indice_len_x = 14 * SVG.width / 500;
  var indice_len_y = 14 * SVG.height / 500;
  var svg_width = parseInt($("#root-svg").css("width").replace("px", ""));
  var svg_height = parseInt($("#root-svg").css("height").replace("px", ""));
  var x = Math.abs(50 - 100 * trans_x / SVG.width);
  var y = Math.abs(50 - 100 * trans_y / SVG.height);
  var x_signe = "";
  var y_signe = "";
  if ((100 * trans_x / SVG.width) > 50)
    x_signe = "-";
  if ((100 * trans_y / SVG.height) > 50)
    y_signe = "-";
  return "translate(" + x_signe + x + "%," + y_signe + y + "%)";
}

function fit_page_to_drawing() {
  "use strict";
  $('.description').addClass('hidden');
  $("#svg svg").css("transform", "scale(1)");
  $("#root-svg").css("transform", "initial");
}

function real_zoom(element) {
  "use strict";
  if (document.getElementById('svg').classList.contains('edit-mode'))
    return;
  $("#svg.show").addClass("duration");
  var id = $(element).attr("id");
  if (id.startsWith("indice"))
    var index = id.substring(7);
  else
    var index = id.substring(12);
  var indice = document.getElementById("indice-" + index);
  var description = $("#description-" + index);
  if (
    document.getElementById('content').getAttribute('data-real-zoom-indice') == index
    && indice.getAttribute("data-zoom-active") == "true"
  )
  {
    $("#svg svg").css("transform", "scale(1)");
    indice.setAttribute("data-zoom-active", false);
    description.addClass("hidden");
  }
  else {
    var scale   = indice.getAttribute("data-zoom") / 100;
    var trans_x = parseFloat(indice.getAttribute("data-translate-x") - SVG.x);
    var trans_y = parseFloat(indice.getAttribute("data-translate-y") - SVG.y);
    $("#svg svg").css("transform", "scale(" + scale + ")");
    $("#root-svg").css("transform", translate(trans_x, trans_y));
    indice.setAttribute("data-zoom-active", true);
    document.getElementById('content').setAttribute('data-real-zoom-indice', index);
    $('.description').addClass('hidden');
    if (description.find(".description-content").html().trim() != "") {
      description.removeClass("hidden");
    }
  }
}

$(document).ready(function() {
    SVG.init();
});
</script>
</body>
</html>
